import copy
if __name__ == '__main__':
    N,K=list(map(int,input().split()))
    Jewelries_org=list(map(int,input().split()))
    ans=0
    upper=min(N,K)
    for a in range(upper+1):
        for b in range(upper-a+1):
            hand=[]
            Jewelries=copy.deepcopy(Jewelries_org)
            for i in range(a):
                hand.append(Jewelries.pop(0))
            for i in range(b):
                hand.append(Jewelries.pop(-1))
            hand.sort()
            for i in range(K-(a+b)):
                if hand.__len__()>0 and hand[0]<0:
                    hand.pop(0)
            s=sum(hand)
            if s>ans:
                ans=s
    print(ans)

